	(52, '2023-05-09 10:31:01', 'add', 'blog_tutoriales', '1', 'INSERT INTO blog_tutoriales (`titulo`, `portada`, `resumen`, `categoria`, `estado`, `contenido`, `autor`, `date_created`)  VALUES (?, ?, ?, ?, ?, ?, ?, ?)', '1', '::1', 'blog_tutoriales/add', '{"titulo":"Lorem Ipsum","portada":"app\\/uploads\\/files\\/blog_1683639058.jpg","resumen":"Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.","categoria":"Blogs de prueba","estado":"Publicado","contenido":"<h3 class=\\"f5 cl-orange mb16\\" style=\\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 1em; line-height: 1.28571;\\"><span style=\\"font-family: &quot;Times New Roman&quot;;\\">HEDONIST ROOTS<\\/span><\\/h3><p class=\\"f4 cl-white mt0 mb16\\" style=\\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 1em; line-height: 1.5;\\"><img src=\\"http:\\/\\/localhost\\/pulpa-framework\\/app\\/uploads\\/files\\/vf85z64_uar70kb.png\\" style=\\"width: 25%; float: left;\\" class=\\"note-float-left\\"><span style=\\"font-size: 1rem;\\">Until recently, the prevailing view assumed&nbsp;lorem ipsum&nbsp;was born as a nonsense text. \\u201cIt\'s not Latin, though it looks like it, and it actually says nothing,\\u201d&nbsp;Before &amp; After&nbsp;magazine&nbsp;<\\/span><a href=\\"https:\\/\\/www.straightdope.com\\/columns\\/read\\/2290\\/what-does-the-filler-text-lorem-ipsum-mean\\/\\" target=\\"_blank\\" rel=\\"noopener\\" title=\\"Straight Dope \\u2013 What Does the Filler Text Lorem Ipsum Mean?\\" style=\\"background-color: rgb(255, 255, 255); font-size: 1rem; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); border-bottom: 1px solid rgb(211, 219, 228); transition: all 400ms cubic-bezier(0.16, 0.68, 0.43, 0.99) 0s;\\">answered a curious reader<\\/a><span style=\\"font-size: 1rem;\\">, \\u201cIts \\u2018words\\u2019 loosely approximate the frequency with which letters occur in English, which is why at a glance it looks pretty real.\\u201d<\\/span><br><\\/p><p class=\\"f4 cl-white mv16\\" style=\\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-top: 1em; margin-bottom: 1em; line-height: 1.5;\\">As Cicero would put it, \\u201cUm, not so fast.\\u201d<\\/p><p class=\\"f4 cl-white mv16\\" style=\\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-top: 1em; margin-bottom: 1em; line-height: 1.5;\\">The placeholder text, beginning with the line&nbsp;\\u201cLorem ipsum dolor sit amet, consectetur adipiscing elit\\u201d, looks like Latin because in its youth, centuries ago, it was Latin.<\\/p><p class=\\"f4 cl-white mv16\\" style=\\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-top: 1em; margin-bottom: 1em; line-height: 1.5;\\">Richard McClintock, a Latin scholar from Hampden-Sydney College, is&nbsp;<a href=\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Lorem_ipsum\\" target=\\"_blank\\" rel=\\"noopener\\" title=\\"Wikipedia \\u2013 Lorem Ipsum\\" style=\\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); border-bottom: 1px solid rgb(211, 219, 228); transition: all 400ms cubic-bezier(0.16, 0.68, 0.43, 0.99) 0s;\\">credited<\\/a>&nbsp;with discovering the source behind the ubiquitous filler text. In seeing a sample of&nbsp;lorem ipsum, his interest was piqued by&nbsp;consectetur\\u2014a genuine, albeit rare, Latin word. Consulting a Latin dictionary led McClintock to a passage from&nbsp;De Finibus Bonorum et Malorum&nbsp;(\\u201cOn the Extremes of Good and Evil\\u201d), a first-century B.C. text from the Roman philosopher Cicero.<\\/p><p class=\\"f4 cl-white mv16\\" style=\\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-top: 1em; margin-bottom: 1em; line-height: 1.5;\\">In particular, the garbled words of&nbsp;lorem ipsum&nbsp;bear an unmistakable resemblance to sections 1.10.32\\u201333 of Cicero\'s work, with the most notable passage excerpted below:<\\/p><blockquote class=\\"page-section__blockquote\\" style=\\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-left: -1rem; padding-left: 1.375em; border-left: 0.375em solid rgb(123, 136, 152); line-height: 1.5;\\">\\u201cNeque porro quisquam est, qui&nbsp;<b>dolorem ipsum<\\/b>&nbsp;quia&nbsp;<b>dolor sit amet, consectetur, adipisci velit, sed<\\/b>&nbsp;quia non numquam eius modi tempora incidunt ut labore et dolore magnam aliquam quaerat voluptatem.\\u201d<\\/blockquote><p class=\\"f4 cl-white mv16\\" style=\\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-top: 1em; margin-bottom: 1em; line-height: 1.5;\\">A 1914 English translation by&nbsp;<a href=\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Lorem_ipsum#English_translation\\" target=\\"_blank\\" rel=\\"noopener\\" title=\\"Wikipedia \\u2013 Lorem Ipsum English Translation\\" style=\\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); border-bottom: 1px solid rgb(211, 219, 228); transition: all 400ms cubic-bezier(0.16, 0.68, 0.43, 0.99) 0s;\\">Harris Rackham<\\/a>&nbsp;reads:<\\/p><blockquote class=\\"page-section__blockquote\\" style=\\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-left: -1rem; padding-left: 1.375em; border-left: 0.375em solid rgb(123, 136, 152); line-height: 1.5;\\">\\u201cNor is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but occasionally circumstances occur in which toil and pain can procure him some great pleasure.\\u201d<\\/blockquote><p class=\\"f4 cl-white mt16 mb0\\" style=\\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-top: 1em; margin-bottom: 0px; line-height: 1.5;\\">McClintock\'s eye for detail certainly helped narrow the whereabouts of&nbsp;<font color=\\"#ffffff\\" face=\\"Mercury SSm A, Mercury SSm B, Georgia, Times, Times New Roman, Microsoft YaHei New, Microsoft Yahei, \\u5fae\\u8f6f\\u96c5\\u9ed1, \\u5b8b\\u4f53, SimSun, STXihei, \\u534e\\u6587\\u7ec6\\u9ed1, serif\\"><span style=\\"font-size: 1.1875em; background-color: rgb(85, 98, 113);\\">lorem ipsum\'s<\\/span><\\/font>&nbsp;origin, however, the \\u201chow and when\\u201d still remain something of a mystery, with competing theories and timelines.<\\/p>"}', 'true', NULL),
