	(1, 'Lorem Ipsum', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.', 'app/uploads/files/blog_1683639058.jpg', 'Blogs de prueba', NULL, '<h3 class="f5 cl-orange mb16" style="-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 1em; line-height: 1.28571;"><span style="font-family: &quot;Times New Roman&quot;;" times="" new="" roman";"="">HEDONIST ROOTS</span></h3><p class="f4 cl-white mt0 mb16" style="-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 1em; line-height: 1.5;"><img src="http://localhost/pulpa-framework/app/uploads/files/vf85z64_uar70kb.png" style="width: 25%; float: left;" class="note-float-left"><span style="font-size: 1rem;">Until recently, the prevailing view assumed&nbsp;lorem ipsum&nbsp;was born as a nonsense text. It\'s not Latin, though it looks like it, and it actually says nothing,&nbsp;Before &amp; After&nbsp;magazine&nbsp;</span><a href="https://www.straightdope.com/columns/read/2290/what-does-the-filler-text-lorem-ipsum-mean/" target="_blank" rel="noopener" title="Straight Dope  What Does the Filler Text Lorem Ipsum Mean?" style="background-color: rgb(255, 255, 255); font-size: 1rem; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); border-bottom: 1px solid rgb(211, 219, 228); transition: all 400ms cubic-bezier(0.16, 0.68, 0.43, 0.99) 0s;">answered a curious reader</a><span style="font-size: 1rem;">, Its 땅ords loosely approximate the frequency with which letters occur in English, which is why at a glance it looks pretty real.</span><br></p><p class="f4 cl-white mv16" style="-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-top: 1em; margin-bottom: 1em; line-height: 1.5;">As Cicero would put it, Um, not so fast.</p><p class="f4 cl-white mv16" style="-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-top: 1em; margin-bottom: 1em; line-height: 1.5;">The placeholder text, beginning with the line&nbsp;Lorem ipsum dolor sit amet, consectetur adipiscing elit, looks like Latin because in its youth, centuries ago, it was Latin.</p><p class="f4 cl-white mv16" style="-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-top: 1em; margin-bottom: 1em; line-height: 1.5;">Richard McClintock, a Latin scholar from Hampden-Sydney College, is&nbsp;<a href="https://en.wikipedia.org/wiki/Lorem_ipsum" target="_blank" rel="noopener" title="Wikipedia  Lorem Ipsum" style="-webkit-tap-highlight-color: rgba(0, 0, 0, 0); border-bottom: 1px solid rgb(211, 219, 228); transition: all 400ms cubic-bezier(0.16, 0.68, 0.43, 0.99) 0s;">credited</a>&nbsp;with discovering the source behind the ubiquitous filler text. In seeing a sample of&nbsp;lorem ipsum, his interest was piqued by&nbsp;consectetur다 genuine, albeit rare, Latin word. Consulting a Latin dictionary led McClintock to a passage from&nbsp;De Finibus Bonorum et Malorum&nbsp;(On the Extremes of Good and Evil), a first-century B.C. text from the Roman philosopher Cicero.</p><p class="f4 cl-white mv16" style="-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-top: 1em; margin-bottom: 1em; line-height: 1.5;">In particular, the garbled words of&nbsp;lorem ipsum&nbsp;bear an unmistakable resemblance to sections 1.10.3233 of Cicero\'s work, with the most notable passage excerpted below:</p><blockquote class="page-section__blockquote" style="-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-left: -1rem; padding-left: 1.375em; border-left: 0.375em solid rgb(123, 136, 152); line-height: 1.5;"><span style="font-family: &quot;Times New Roman&quot;;">Neque porro quisquam est, qui&nbsp;</span><b>dolorem ipsum</b><span style="font-family: &quot;Times New Roman&quot;;">&nbsp;quia&nbsp;</span><b>dolor sit amet, consectetur, adipisci velit, sed</b><span style="font-family: &quot;Times New Roman&quot;;">&nbsp;quia non numquam eius modi tempora incidunt ut labore et dolore magnam aliquam quaerat voluptatem.</span></blockquote><p class="f4 cl-white mv16" style="-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-top: 1em; margin-bottom: 1em; line-height: 1.5;">A 1914 English translation by&nbsp;<a href="https://en.wikipedia.org/wiki/Lorem_ipsum#English_translation" target="_blank" rel="noopener" title="Wikipedia  Lorem Ipsum English Translation" style="-webkit-tap-highlight-color: rgba(0, 0, 0, 0); border-bottom: 1px solid rgb(211, 219, 228); transition: all 400ms cubic-bezier(0.16, 0.68, 0.43, 0.99) 0s;">Harris Rackham</a>&nbsp;reads:</p><blockquote class="page-section__blockquote" style="-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-left: -1rem; padding-left: 1.375em; border-left: 0.375em solid rgb(123, 136, 152); line-height: 1.5;">Nor is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but occasionally circumstances occur in which toil and pain can procure him some great pleasure.</blockquote><p class="f4 cl-white mt16 mb0" style="-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-top: 1em; margin-bottom: 0px; line-height: 1.5;">McClintock\'s eye for detail certainly helped narrow the whereabouts of&nbsp;<font color="#ffffff" face="Mercury SSm A, Mercury SSm B, Georgia, Times, Times New Roman, Microsoft YaHei New, Microsoft Yahei, 籃쉳쫊副部, 丹擔, SimSun, STXihei, 꼝雷某部, serif"><span style="font-size: 1.1875em; background-color: rgb(85, 98, 113);">lorem ipsum\'s</span></font>&nbsp;origin, however, the 랃ow and when still remain something of a mystery, with competing theories and timelines.</p>', '1', 'Publicado', '2023-05-09 10:31:01', '2023-05-09 10:32:21', NULL, NULL);
