-- Volcando estructura para procedimiento db_core.purge_idle_connections
DROP PROCEDURE IF EXISTS `purge_idle_connections`;
DELIMITER //
CREATE PROCEDURE `purge_idle_connections`()
    COMMENT 'Desconecta las conecciones que permaneces inactiva un determinado tiempo.'
BEGIN
    DECLARE done BOOLEAN DEFAULT FALSE;
    DECLARE max_time INT DEFAULT COALESCE(@max_kill_time, 200);
    DECLARE pid BIGINT;
    DECLARE c CURSOR FOR

    SELECT id FROM information_schema.processlist WHERE command IN('Sleep') AND TIME > max_time;

    DECLARE CONTINUE handler FOR NOT FOUND
    SET done = TRUE;
    OPEN c;
    SET @q_kill = 'KILL ?';
    PREPARE q_kill FROM @q_kill;

    PURGELOOP: loop
        fetch c INTO pid;
        if done then
            leave PURGELOOP;
        END if;
        SET @pid = pid;

        EXECUTE q_kill USING @pid;
    END loop;

    DEALLOCATE PREPARE q_kill;
END//
DELIMITER ;

-- Volcando estructura para procedimiento db_core.rebuild_index
DROP PROCEDURE IF EXISTS `rebuild_index`;
DELIMITER //
CREATE PROCEDURE `rebuild_index`(
	IN `tabla` VARCHAR(50),
	IN `campo` VARCHAR(50)
)
    COMMENT 'Reconstruye indices autoincrementales, en grandes volumnenes de datos y muchas tablas relacionadas puede ser muy lento.'
BEGIN
	SET @num := 0;
	SET @upd = CONCAT('UPDATE ',tabla,' SET ',campo,' = @num := (@num+1)');

	PREPARE sentencia FROM @upd;
	EXECUTE sentencia;
	DEALLOCATE PREPARE sentencia;
END//
DELIMITER ;

-- Volcando estructura para procedimiento db_core.set_all_user_permissions
DROP PROCEDURE IF EXISTS `set_all_user_permissions`;
DELIMITER //
CREATE PROCEDURE `set_all_user_permissions`(
	IN `user_id` INT
)
    COMMENT 'Habilita todos los permisos al usuario indicado.'
BEGIN
		SELECT user_id AS role_id, p.page_name, a.action_name
		FROM role_permissions_actions a
		CROSS JOIN role_permissions_page p;
END//
DELIMITER ;

-- Volcando estructura para funci칩n db_core.proper_case
DROP FUNCTION IF EXISTS `proper_case`;
DELIMITER //
CREATE FUNCTION `proper_case`(
	`str` VARCHAR(128)
) RETURNS varchar(128) CHARSET utf8mb4 COLLATE utf8mb4_unicode_ci
    DETERMINISTIC
    COMMENT 'Convierte la primera letra de cada palabra de un texto en may칰scula.'
BEGIN
DECLARE n, pos INT DEFAULT 1;
DECLARE sub, proper VARCHAR(128) DEFAULT '';

if length(trim(str)) > 0 then
    WHILE pos > 0 DO
        set pos = locate(' ',trim(str),n);
        if pos = 0 then
            set sub = lower(trim(substr(trim(str),n)));
        else
            set sub = lower(trim(substr(trim(str),n,pos-n)));
        end if;

        set proper = concat_ws(' ', proper, concat(upper(left(sub,1)),substr(sub,2)));
        set n = pos + 1;
    END WHILE;
end if;

RETURN trim(proper);
END//
DELIMITER ;

